import React from "react";
function Header() {
  return (
    <div style = {divStyle}>
      <h1>Todo</h1>
    </div>
  );
}

const divStyle = {
    background : '#333 ',
    color: '#ffff',
    textAlign : 'center',
    padding : '10px'
}
export default Header;
